description:
Whose Line Is It Anyway? Complete Season 9 (12 episodes)

&quot;In every episode Aisha Tyler hosts a skit comedy show where the actors on the show, usually Wayne Brady, Colin Mochrie, Ryan Stiles and another guest star or two do different comedy skits. It's all improv and made up on the spot. It's like the original Whose Line is it Anyway that ran from 1998 until 2006.&quot;

Files are mostly HD, around 500mb, but some are smaller 720p files.
